":null,"additionalInfo":"","additionalTicketText":"","ageLimitCode":"OVER_21","ageLimit":"21 and Over","showTypeCode":null,"showType":"","eventStatusCode":"BUY","eventStatus":"Buy","eventStatusMessage":"","ticketPurchaseUrl":"https://www.ticketfly.com/purchase/event/1383263?utm_medium=api","ticketPrice":"$12.00","externalTicketingUrls":[],"multiEventCartable":true,"facebookEventId":"","facebookEventIdString":"","headliners":[{"id":769247,"name":"Homeshake","startTime":null,"eventDescription":"Homeshake is the pseudonym and solo project of Edmonton-born, Montreal-based musician Peter Sagar. As follow up to his 2014 debut In the Shower, Homeshake will released his sophomore effort Midnight Snack in the Fall of 2015 via Sinderlyn. Midnight Snack was recorded this past winter with Jackson MacIntosh at the Drones club in Montreal. Musically this time around Sagar trades in his guitar for synthesizers and a drum machine, developing vocal arrangements from loops he created for his solo set. He pulled influence from house pioneers like Chip E and Mr. Fingers as well as Japanese pop starlets like Chiemi Manabe, slowing down the tempo with his own homemade drowsiness.

The resulting collection is an eclectic tangle of personal anecdotes steeped in an everlasting reverence of D’Angelo and R Kelly. Much of the record was written following Sagar’s dizzying time on the road as touring guitarist with Mac Demarco, reflecting on the loneliness that plagued him towards the end of his run and the longing for life back home in Montreal. Sagar left the band to focus on his own music and to rebuild the infrastructure of his life.

